<script type=""text/ng-template"" id=""skfProgramPrivilageModal.html"">
    <div class=""popup-user-role"">
        <div class=""modal-header"">
            <span class=""model-breadcrumb"">{{'Role / Program / Privilege Relation' | translate}}</span>
            <div class=""col-lg-8 col-md-8 col-sm-12 heading"">
                <h4 class=""page-header text-primary""> {{rowData.RoleName}} </h4>
            </div>
            <div class=""col-lg-4 col-md-4 col-sm-12 create-button  menu-button"">
                <span class=""Pipe""></span>
                <a ng-click=""save()"" title={{'Save'|translate}}><i class=""fa fa-save icon-filter""></i><span>{{'Save' | translate}}</span></a>
                <a ng-click=""cancel()"" title={{'Close'|translate}}><i class=""fa fa-close icon-filter""></i><span>{{'Close' | translate}}</span></a>
            </div>
        </div>
        <div class=""modal-body rolerel"">
            <div class=""multi-drag row"">
                <div ng-repeat=""list in models"" class=""col-md-6"">
        ");
            WriteLiteral(@"            <div class=""panel panel-{{list.cssClass}}"">
                        <div class=""select-button"">

                            <a class=""btn btn-info right"" ng-click=""ShuttleRight(list)"" title=""{{'Move right'|translate}}"" ng-disabled=""!btnright""></a>
                            <a class=""btn btn-info right rightAll"" ng-click=""ShuttleRightAll(list)"" title=""{{'Move all'|translate}}"" ng-disabled=""list.items.length <= 0""></a>
                            <a class=""btn btn-info left leftAll"" ng-click=""ShuttleLeftAll(list)"" title=""{{'Move right'|translate}}"" ng-disabled=""list.items.length <= 0""></a>
                            <a class=""btn btn-info left"" ng-click=""ShuttleLeft(list)"" title=""{{'Move left'|translate}}"" ng-disabled=""!btnleft""> </a>
                        </div>
                        <div class=""panel-heading"">
                            <div class=""row"">
                                <div class=""col-md-4 list-heading"">
                                    <h3 class=""panel-titl");
            WriteLiteral(@"e"">{{list.listName}}</h3>
                                </div>
                            </div>
                        </div>
                        <div class=""panel-body"">
                            <ul dnd-list dnd-drop=""onDrop(list, item, index)"">
                                <li ng-repeat=""item in list.items""
                                    dnd-draggable=""getSelectedItemsIncluding(list, item)""
                                    dnd-dragstart=""onDragstart(list, event)""
                                    dnd-moved=""onMoved(list)""
                                    dnd-dragend=""list.dragging = false""
                                    dnd-selected=""setSelected(list,item)""
                                    ng-class=""{'selected': item.selected}""
                                    ng-hide=""list.dragging && item.selected"">
                                    <div class=""row"">
                                        <p class=""col-md-7"">:::  {{item.ProgramName}}</p>

        ");
            WriteLiteral(@"                                <div ng-if=""list.listName == 'Associated'"" class=""btn-group col-md-4"" uib-dropdown auto-close=""outsideClick"" ng-click=""privilageCheck(item)"">
                                            <a id=""simpleDropdown"" class=""toggle-down"" uib-dropdown-toggle>{{'Privilege(s)' | translate}} <i class=""fa fa-link""></i></a>
                                            <ul class=""dropdown-menu program-privilage"" uib-dropdown-menu role=""menu"" aria-labelledby=""simpleDropdown"">
                                                <li role=""menuitem"" ng-repeat=""pre in item.Privileges"">
                                                    <span>
                                                        <input type=""checkbox"" ng-model=""pre.Active"" ng-true-value=""'Y'"" ng-false-value=""'N'"" />
                                                    </span>
                                                    <span>{{pre.PrivilegeName}}</span>
                                                </li>
           ");
            WriteLiteral(@"                                 </ul>
                                        </div>
                                        <div ng-if=""list.listName == 'Associated'"" class=""btn-group col-md-1"" title=""{{'Hide Program View'|translate}}""><input type=""checkbox"" ng-model=""item.HideProgram"" ng-true-value=""'Y'"" ng-false-value=""'N'""></div>
                                    </div>
                                </li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        <div class=""modal-footer"">
        </div>
    </div>
</script>");
